  private static void printDefault() throws Exception {
    System.out.println("# Default");
    print(SSLContext.getDefault());
  }

  private static void print(String protocol) throws Exception {
    System.out.println("# " + protocol);
    SSLContext context = SSLContext.getInstance(protocol);
    context.init(null, null, null);
    print(context);
  }

  private static void print(SSLContext context) throws Exception {
    System.out.println("## SSLContext: " + context.getProtocol());
    SSLParameters contextParameters = context.getDefaultSSLParameters();
    printSSLParameters(contextParameters);

    System.out.println("## SSLParameters: " + context.getProtocol());
    SSLEngine engine = context.createSSLEngine();
    System.out.println("Protocol(enabled): " + Arrays.toString(engine.getEnabledProtocols()));
    System.out.println("Protocol(supported): " + Arrays.toString(engine.getSupportedProtocols()));
    System.out.println("CipherSuites(enabled): " + Arrays.toString(engine.getEnabledCipherSuites()));
    System.out.println("CipherSuites(supported): " + Arrays.toString(engine.getSupportedCipherSuites()));
    check(Arrays.equals(engine.getSSLParameters().getProtocols(), engine.getEnabledProtocols()));
    check(Arrays.equals(engine.getSSLParameters().getCipherSuites(), engine.getEnabledCipherSuites()));
    System.out.println();
  }

  private static void printSSLParameters(SSLParameters parameters) {
    System.out.println("Protocol: " + Arrays.toString(parameters.getProtocols()));
    System.out.println("CipherSuites: " + Arrays.toString(parameters.getCipherSuites()));
  }

  private static void check(boolean condition) {
    if (!condition) {
      throw new RuntimeException();
    }
  }
